import React, { Component } from 'react';
import ReactDOM from 'react-dom';
require('./bootstrap');
import Layout from './Layout';
import { BrowserRouter} from 'react-router-dom';

ReactDOM.render(
    <BrowserRouter>
        <Layout />
    </BrowserRouter>, document.getElementById('root'));
